pragma solidity ^0.8.10;

import {StringsUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/StringsUpgradeable.sol";
import {OwnableUpgradeable} from "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import {ERC165Upgradeable} from "@openzeppelin/contracts-upgradeable/utils/introspection/ERC165Upgradeable.sol";
import {IERC165Upgradeable} from "@openzeppelin/contracts-upgradeable/utils/introspection/IERC165Upgradeable.sol";
import {CountersUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import {FWBMembershipSkeletonNFT} from "./FWBMembershipSkeletonNFT.sol";
import {EIP712Upgradeable} from "@openzeppelin/contracts-upgradeable/utils/cryptography/draft-EIP712Upgradeable.sol";
import {UUPSUpgradeable} from "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import {SignatureCheckerUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/cryptography/SignatureCheckerUpgradeable.sol";

// FWB Core membership contract (Updatable)
contract FWBMembershipNFT is
    OwnableUpgradeable,
    FWBMembershipSkeletonNFT,
    EIP712Upgradeable,
    UUPSUpgradeable
{
    /// @notice URLBase for metadata
    string public urlBase;

    /// @notice Address for signer
    address public signer;

    /// @notice Event for when a new signer is assigned
    event NewSigner(address indexed _signer);

    /// @notice Upgradeable init fn
    function initialize(string memory _urlBase, address _signer)
        public
        initializer
    {
        __Ownable_init();
        __EIP712_init("FWBMembershipNFT", "1");
        __UUPSUpgradeable_init();
        __ERC165_init();

        urlBase = _urlBase;
        signer = _signer;
        emit NewSigner(signer);
    }

    /**
        Admin permission functions and modifiers
     */

    /// @notice UUPS admin upgrade permission fn
    function _authorizeUpgrade(address newImplementation)
        internal
        override
        onlyOwner
    {
        // only owner can upgrade contract
    }

    /**
        URI Management tools
     */

    /// @notice admin function to update base uri
    function updateUrlBase(string memory newUrlBase) external onlyOwner {
        urlBase = newUrlBase;
    }

    /// @notice An owner can set a signer user that can manage memberships
    function setSigner(address _signer) external onlyOwner {
        signer = _signer;
        emit NewSigner(signer);
    }

    /// @notice Getter for url server nft base
    function tokenURI(uint256 id) external view returns (string memory) {
        require(_exists(id), 'ERC721: Token does not exist');
        return
            string(abi.encodePacked(urlBase, StringsUpgradeable.toString(id)));
    }

    /// @notice Admin function to revoke membership for user
    function adminRevokeMemberships(uint256[] memory ids) external onlyOwner {
        for (uint256 i = 0; i < ids.length; i++) {
            _burn(ids[i]);
        }
    }

    function burn(uint256 id) external {
        require(msg.sender == ownerOf(id), "NFT Burn: needs to be owner");
        _burn(id);
    }

    /// @notice Admin function to transfer a wallet to a new NFT address
    function transferFrom(
        address from,
        address to,
        uint256 checkTokenId
    ) external override onlyOwner {
        uint256 tokenId = addressToId[from];
        require(checkTokenId == tokenId, "ERR: Token ID mismatch");

        _transferFrom(from, to, tokenId);
    }

    /// Mint mew membership from the signer account
    function adminMint(address to, uint256 id) external onlyOwner {
        _safeMint(to, id);
    }


    /// @notice list of used signature nonces
    mapping(uint256 => bool) usedNonces;

    /// @notice modifier for valid nonce with signature-based call
    modifier withValidNonceAndDeadline(uint256 nonce, uint256 deadline) {
        require(block.timestamp <= deadline, "Deadline time passed");
        require(!usedNonces[nonce], "nonce used");
        usedNonces[nonce] = true;
        _;
    }

    /// @notice signature permitted mint function typehash
    bytes32 private immutable _PERMIT_MINT_TYPEHASH =
        keccak256(
            "PermitMint(address to,uint256 tokenId,uint256 deadline,uint256 nonce)"
        );

    /// @notice Mint with signed message data
    function mintWithSign(
        address to,
        uint256 tokenId,
        uint256 deadline,
        uint256 nonce,
        bytes memory signature
    ) external withValidNonceAndDeadline(nonce, deadline) {
        // We allow any user to execute a signature to mint the NFt.
        require(to == msg.sender, "Needs to be receiving wallet");

        require(
            SignatureCheckerUpgradeable.isValidSignatureNow(
                // signer is the signer
                signer,
                _hashTypedDataV4(
                    keccak256(
                        abi.encode(
                            _PERMIT_MINT_TYPEHASH,
                            to,
                            tokenId,
                            deadline,
                            nonce
                        )
                    )
                ),
                signature
            ),
            "NFTPermit::mintWithSign: Invalid signature"
        );

        _safeMint(to, tokenId);
    }

    bytes32 private immutable _PERMIT_TRANSFER_TYPEHASH =
        keccak256(
            "PermitTransfer(address from,address to,uint256 tokenId,uint256 deadline,uint256 nonce)"
        );


    /// @notice Transfer with signed message data
    function transferWithSign(
        address from,
        address to,
        uint256 tokenId,
        uint256 deadline,
        uint256 nonce,
        bytes memory signature
    ) external withValidNonceAndDeadline(nonce, deadline) {
        require(to == msg.sender, "Needs to be receiving wallet");

        require(
            SignatureCheckerUpgradeable.isValidSignatureNow(
                signer,
                _hashTypedDataV4(
                    keccak256(
                        abi.encode(
                            _PERMIT_TRANSFER_TYPEHASH,
                            from,
                            to,
                            tokenId,
                            deadline,
                            nonce
                        )
                    )
                ),
                signature
            ),
            "NFTPermit::transferWithSign: Invalid signature"
        );

        _transferFrom(from, to, tokenId);
    }
}
","keccak256":"0x8b9b8751fb7712c64aa932aa67d66b45536bbb2c06e276ee4d3911c5aa02c973","license":"MIT"},"contracts/FWBMembershipSkeletonNFT.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import {ERC165Upgradeable} from "@openzeppelin/contracts-upgradeable/utils/introspection/ERC165Upgradeable.sol";
import {IERC165Upgradeable} from "@openzeppelin/contracts-upgradeable/utils/introspection/IERC165Upgradeable.sol";
import {IERC721Upgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/IERC721Upgradeable.sol";
import {CountersUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import {IERC721MetadataUpgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/IERC721MetadataUpgradeable.sol";

/// @notice Base non-transferrable optimized nft contract for FWB
abstract contract FWBMembershipSkeletonNFT is
    ERC165Upgradeable,
    IERC721Upgradeable,
    IERC721MetadataUpgradeable
{
    using CountersUpgradeable for CountersUpgradeable.Counter;

    /// @notice Counter for totalSupply
    CountersUpgradeable.Counter numberTokens;

    /// @notice Stores address to membership id
    mapping(address => uint256) public addressToId;

    /// @notice Stores membership id to address
    mapping(uint256 => address) public idToAddress;

    /// @notice modifier signifying contract function is not supported
    modifier notSupported() {
        revert("Fn not supported: nontransferrable NFT");
        _;
    }

    /**
        Common NFT functions
     */

    /// @notice NFT Metadata Name
    string public constant name = "FWB Membership NFT";

    /// @notice NFT Metadata Symbol
    string public constant symbol = "FWBMEM";

    /*
     *  NFT Functions
     */

    /// @notice blanaceOf getter for NFT compat
    function balanceOf(address user) public view returns (uint256) {
        return addressToId[user] == 0 ? 0 : 1;
    }

    /// @notice ownerOf getter, checks if token exists
    function ownerOf(uint256 id) public view returns (address) {
        require(
            idToAddress[id] != address(0x0),
            "ERC721: Token does not exist"
        );
        return idToAddress[id];
    }

    /// @notice approvals not supported
    function getApproved(uint256) public view returns (address) {
        return address(0x0);
    }

    /// @notice approvals not supported
    function isApprovedForAll(address, address) public view returns (bool) {
        return false;
    }

    /// @notice approvals not supported
    function approve(address, uint256) public notSupported {}

    /// @notice approvals not supported
    function setApprovalForAll(address, bool) public notSupported {}

    /// @notice internal safemint function
    function _safeMint(address to, uint256 id) internal {
        require(idToAddress[id] == address(0x0), "Mint: already claimed");
        require(
            to != address(0x0) && id != 0,
            "Mint: cannot mint null id or to"
        );
        numberTokens.increment();
        _transferFrom(address(0x0), to, id);
    }

    /// @notice transfer function to be overridden
    function transferFrom(
        address from,
        address to,
        uint256 checkTokenId
    ) external virtual {}

    /// @notice not supported
    function safeTransferFrom(
        address,
        address,
        uint256
    ) public notSupported {
        // no impl
    }

    /// @notice not supported
    function safeTransferFrom(
        address,
        address,
        uint256,
        bytes memory
    ) public notSupported {
        // no impl
    }

    /// @notice erc721 enumerable partial impl
    function totalSupply() public view returns (uint256) {
        return numberTokens.current();
    }

    /// @notice Supports ERC721, ERC165
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC165Upgradeable, IERC165Upgradeable)
        returns (bool)
    {
        return
            ERC165Upgradeable.supportsInterface(interfaceId) ||
            interfaceId == type(IERC721Upgradeable).interfaceId ||
            interfaceId == type(IERC721MetadataUpgradeable).interfaceId;
    }

    /// @notice internal burn for virtual nfts
    /// @param id of nft to burn
    function _burn(uint256 id) internal {
        address from = ownerOf(id);
        numberTokens.decrement();
        delete idToAddress[id];
        delete addressToId[from];
        emit Transfer(from, address(0x0), id);
    }

    /// @notice internal exists fn for a given token id
    function _exists(uint256 id) internal view returns (bool) {
        return idToAddress[id] != address(0x0);
    }

    /// @notice internal transfer function for virtual nfts
    /// @param from address to move from
    /// @param to address to move to
    /// @param id id of nft to move
    function _transferFrom(
        address from,
        address to,
        uint256 id
    ) internal {
        addressToId[from] = 0x0;
        idToAddress[id] = to;
        addressToId[to] = id;
        emit Transfer(from, to, id);
    }
}
